import React,{useState} from 'react';

function Slide(props) 
{
    if(props.slidevalue==0)
    {
      return (
        <div class="content col col-10 col-md-10">
          <h1 class="contenttext"> <b> {"GOC Workshop"} </b></h1>
          <img class="slidecontent" src="images/slide_2.jpg" alt="" ></img>
        </div>
      );
    }
    if(props.slidevalue==1)
    {
      return (
        <div class="content col col-10 col-md-10">
          <h1 class="contenttext"> <b> {"Southern Railway"} </b></h1>
          <img class="slidecontent" src="images/slide_3.jpg" alt="" ></img>
        </div>
      );
    }
    if(props.slidevalue==2)
    {
      return (
        <div class="content col col-10 col-md-10">
          <h1 class="contenttext"> <b> {"Calendar"} </b></h1>
          <img class="slidecontent" src="images/slide_4.jpg" alt="" ></img>
        </div>
      );
    }
    
}

export default Slide;
